import React from "react";
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "./Header.css";

const Header = () => {
  return (
    <div className="container">
      <h3>
        <span className="small">Build Your</span>
        <div> DREAM TEAM</div>
      </h3>
    </div>
  );
};

export default Header;
